    def compute(self) -> None:
        """Compute digits of [L, R) by repeating multiplication until only one digit left."""
        self.total = 0
        self.pos[0] = self.l
        self.zeros[0] = 1
        for i in range(1, self.n):
            self.pos[i] = self.pos[i - 1] * 10
            self.zeros[i] = self.zeros[i - 1] + 1
            if self.pos[i] == 0:
