    def printDigits(self) -> None:
        """Prints the number of digits of each number in [L, R)."""
        self.findDigits()
        print(*self.digits, sep=' ')

    def numDigits(self, i: int) -> int:
        """Returns the number of digits of the number i."""
        if i < 0:
            return 0
        return self.digits[i // self.zeros[i] - 1]

    def printNumDigits(self, i: int) -> None:
        """Prints the number of digits of the number i."""
        self.numDigits(i)

